import React from 'react';
import ScrollToBottom from 'react-scroll-to-bottom';
import './Message.css';

const Message=({messages,name})=>(
    <ScrollToBottom>
        {messages.map((message,i)=><div key={i}><Messages message={message} name={name}/></div>)}
    </ScrollToBottom>
)

export default Message;
